import React from 'react'
import {Button, Card} from 'antd'
import './style-form.css'
const StatusForm = () => {
  return (
    <Card style={{ width: "100%", borderRadius: 12, boxShadow: '3px 3px 3px gray' }}>
        <div style={{textAlign: 'center'}}>Hello, What thing you wanna share!</div>
        <Button className="button-status" style={{width: '100%', height: '50px', borderColor:'yellow'}}>Create New Post</Button>
    </Card>
  )
}

export default StatusForm
